import React from 'react';

const VoituresData = () => {

    const voituresData = [
        { id: 1, image: "./image/voiture_ford_1.jpg" },
        { id: 2, image: "./image/voiture_ford_1.jpg" }
    ];

    return (
        <div>
            {voituresData.map((photo) => {
                return <img key={photo.id} src={require(photo.image)} />
            })}
        </div>
    );
};

export default VoituresData;
